(def learningrate-vs-probs
  (let [vc 9]
    (sort-by 
      first
      (doall (map (fn [e w b] 
             [(get-in e [:exp-params :training-params :learning_rate]) 
                    (map #(f/prob-visi (create-theoretical-rbm w (vec (take vc b)) (vec (drop vc b))) %) bars)])
         exps weights biases)))))
