(defn lr-vs-probs [exps]
  (let [vc 9]
    (sort-by 
      first
      (doall (map (fn [[lr w b]] 
             [lr 
                    (map #(f/prob-visi (create-theoretical-rbm w (vec (take vc b)) (vec (drop vc b))) %) bars)])
         exps)))))
